import { useEffect, useState } from 'react';
import './App.css';
import ArtistList from './components/ArtistList.js';
import AlbumList from './components/AlbumList.js';
import GenreList from './components/GenreList.js';


function App() {

    const [artist_list, setArtistList] = useState([]);
    const [page, setPage] = useState(1);

    function prevPage() {
        if (page === 1) {
            return;
        }
        setPage(page - 1);
    }

    function nextPage() {
        setPage(page + 1);
    }

    useEffect(() => {
        fetch(`http://localhost:8000/artists?page=${page}&limit=50&`)
            .then(res => res.json())
            .then(json => {
                setArtistList(json);
            })
    }, [page]);

    return (
        <>
            <div className='navbar'>
            <div class="sm-logo">
                <a>SPOTIFY</a>
            </div>
            <ul class="sm-nav-menu">
                <li><button class="nav-links">about</button></li>
                <li><button class="nav-links">work</button></li>
                <li><button class="nav-links">services</button></li>
                <li><button class="nav-links">contact</button></li>
            </ul>
            </div>

            {/* <div>Artists</div>
            {
